import { useState } from "react";

function LatestTransactions() {
  const [latestTransactions, setLatestTransactions] = useState([
    {
      description: "McDonalds",
      date: new Date(),
      type: "EXPENSE",
    },
    {
      description: "Spotify",
      date: new Date(),
      type: "EXPENSE",
    },
  ]);

  return (
    <div className="LatestTransactions mt-10 ml-20 md:ml-0 mr-6 flex-1">
      <h2 className="font-bold text-2xl text-left mb-4">Latest Transactions</h2>
      <input
        className="border w-full rounded-md h-8 px-4"
        placeholder="Search"
        type="text"
      />
      {latestTransactions.map((l, i) => {
        return (
          <div className="text-left" key={i}>
            <div className="flex flex-row">
              <div>
                <p>{l.description}</p>
                <span className="text-gray-500">{l.date.toLocaleDateString("dd-mm-yyyy")}</span>
              </div>
              <div></div>
            </div>
          </div>
        );
      })}
    </div>
  );
}

export default LatestTransactions;
